INSERT INTO `wp_posts` VALUES (1,1,'2017-11-30 07:23:22','2017-11-30 07:23:22','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2017-11-30 07:23:22','2017-11-30 07:23:22','',0,'http://contouredink.com/?p=1',0,'post','',1),(11,1,'2018-01-04 05:12:19','2018-01-04 05:12:19','','Home','','publish','closed','closed','','home','','','2018-01-21 21:11:33','2018-01-21 21:11:33','',0,'http://contouredink.com/?page_id=11',0,'page','',0),(12,1,'2018-01-04 05:12:19','2018-01-04 05:12:19','','Home','','inherit','closed','closed','','11-revision-v1','','','2018-01-04 05:12:19','2018-01-04 05:12:19','',11,'http://contouredink.com/2018/01/04/11-revision-v1/',0,'revision','',0),(14,1,'2018-01-04 05:13:53','2018-01-04 05:13:53','<p class=\"p1\"><b>Microblading offers a semi-permanent enhancement solution in Denver, CO</b></p>\r\n<p class=\"p3\">Microblading is the fastest growing eyebrow treatment procedure in the world. Unlike a regular tattoo, microblading involves a form of tattoo artistry in which the pigment is implanted under your skin with a handheld tool instead of a machine. Our eyebrow microblading makeup technician draws hair-like strokes on your brow to mimic natural hairs to give you a reshaped, 3D-like result. The cool thing about eyebrow microblading is that you can have zero brows, blonde ultra-faint brows, have lost your brows due to alopecia, cancer or you may just need a little help filling your arches in. Either way our eyebrow makeup technicians got you covered and will create a legit appearance of naturally full brows.</p>\r\n<p class=\"p3\">Visit Contoured Ink Studio &amp; Beauty Bar to learn more about microblading.</p>\r\n<p class=\"p1\"><b>WE CAN ALSO REMOVE PREVIOUS WORK</b></p>\r\n<p class=\"p3\">If you’ve had Microblading done elsewhere and aren’t happy with the results, we offer saline tattoo removal. This is an alternative to the traditional laser removal method. We use a naturally based saline solution that we implant into the skin with a hand tool. The process is less invasive and much less expensive than going with the laser removal process. As the area heals, the scabs that form will then fall off while pulling the pigment with it. Pricing and how many sessions will depend on what needs to be corrected.\r\n\r\nCall 303-994-9439 today to schedule microblading in the Denver, CO area.</p>','Microblading','','publish','closed','closed','','microblading','','','2018-01-04 05:21:37','2018-01-04 05:21:37','',0,'http://contouredink.com/?page_id=14',0,'page','',0),(15,1,'2018-01-04 05:13:53','2018-01-04 05:13:53','','Microblading','','inherit','closed','closed','','14-revision-v1','','','2018-01-04 05:13:53','2018-01-04 05:13:53','',14,'http://contouredink.com/2018/01/04/14-revision-v1/',0,'revision','',0),(16,1,'2018-01-04 05:14:14','2018-01-04 05:14:14','<p class=\"p1\"><b>Thicken Your Lashes</b></p>\r\n<p class=\"p3\"><b>Xtreme Lashes offer a natural look in Denver, CO</b></p>\r\n<p class=\"p4\">When you’re looking to thicken your eyelashes without the damage caused by mascara, Xtreme Lashes offers a natural-looking alternative. Contoured Ink Studio &amp; Beauty Bar’s certified Xtreme Lashes technician can transform your lashes to the customized look you select. These semi-permanent eyelash extensions are attached one by one to your natural lash.</p>\r\n<p class=\"p4\">Xtreme Lashes:</p>\r\n\r\n<ul class=\"ul1\">\r\n 	<li class=\"li4\">Take approximately three hours to apply</li>\r\n 	<li class=\"li4\">Provide natural looking lashes</li>\r\n 	<li class=\"li4\">Need to be maintained every two to three weeks</li>\r\n</ul>\r\n<p class=\"p4\">Xtreme Lashes are designed with a thicker base and tapered tip to resemble the look of natural eyelashes. If you\'re looking for Xtreme Lashes, eyelash extensions or synthetic eyelashes in Denver, CO Contoured Ink Studio &amp; Beauty Bar has you covered. Call 303-994-9439 today to learn more about Xtreme Lashes.</p>\r\n<p class=\"p3\"><b>YOUR NEW LASHES WILL SHED NATURALLY</b></p>\r\n<p class=\"p4\">While you’re relaxing and being pampered during your initial eyelash extension appointment, you can rest easy knowing that we use a medical-grade, fume-free glue to secure your new synthetic eyelashes. Because Xtreme Lashes are attached to your natural lash, they’ll shed naturally.\r\n\r\nContact Contoured Ink Studio &amp; Beauty Bar to schedule your Xtreme Lashes application in the Denver, CO area.</p>','Xtreme Lashes','','publish','closed','closed','','xtreme-lashes','','','2018-01-04 05:22:08','2018-01-04 05:22:08','',0,'http://contouredink.com/?page_id=16',0,'page','',0),(17,1,'2018-01-04 05:14:14','2018-01-04 05:14:14','','Xtreme Lashes','','inherit','closed','closed','','16-revision-v1','','','2018-01-04 05:14:14','2018-01-04 05:14:14','',16,'http://contouredink.com/2018/01/04/16-revision-v1/',0,'revision','',0),(18,1,'2018-01-04 05:14:27','2018-01-04 05:14:27','[Best_Wordpress_Gallery id=\"4\" gal_title=\"Images\"]','Portfolio','','publish','closed','closed','','portfolio','','','2018-01-21 21:28:27','2018-01-21 21:28:27','',0,'http://contouredink.com/?page_id=18',0,'page','',0),(19,1,'2018-01-04 05:14:27','2018-01-04 05:14:27','','Portfolio','','inherit','closed','closed','','18-revision-v1','','','2018-01-04 05:14:27','2018-01-04 05:14:27','',18,'http://contouredink.com/2018/01/04/18-revision-v1/',0,'revision','',0),(20,1,'2018-01-04 05:14:46','2018-01-04 05:14:46','','Testimonials','','publish','closed','closed','','testimonials','','','2018-01-04 05:14:46','2018-01-04 05:14:46','',0,'http://contouredink.com/?page_id=20',0,'page','',0),(21,1,'2018-01-04 05:14:46','2018-01-04 05:14:46','','Testimonials','','inherit','closed','closed','','20-revision-v1','','','2018-01-04 05:14:46','2018-01-04 05:14:46','',20,'http://contouredink.com/2018/01/04/20-revision-v1/',0,'revision','',0),(22,1,'2018-01-04 05:15:06','2018-01-04 05:15:06','','Contact','','publish','closed','closed','','contact','','','2018-01-04 05:15:06','2018-01-04 05:15:06','',0,'http://contouredink.com/?page_id=22',0,'page','',0),(23,1,'2018-01-04 05:15:06','2018-01-04 05:15:06','','Contact','','inherit','closed','closed','','22-revision-v1','','','2018-01-04 05:15:06','2018-01-04 05:15:06','',22,'http://contouredink.com/2018/01/04/22-revision-v1/',0,'revision','',0),(24,1,'2018-01-04 05:21:37','2018-01-04 05:21:37','<p class=\"p1\"><b>Microblading offers a semi-permanent enhancement solution in Denver, CO</b></p>\r\n<p class=\"p3\">Microblading is the fastest growing eyebrow treatment procedure in the world. Unlike a regular tattoo, microblading involves a form of tattoo artistry in which the pigment is implanted under your skin with a handheld tool instead of a machine. Our eyebrow microblading makeup technician draws hair-like strokes on your brow to mimic natural hairs to give you a reshaped, 3D-like result. The cool thing about eyebrow microblading is that you can have zero brows, blonde ultra-faint brows, have lost your brows due to alopecia, cancer or you may just need a little help filling your arches in. Either way our eyebrow makeup technicians got you covered and will create a legit appearance of naturally full brows.</p>\r\n<p class=\"p3\">Visit Contoured Ink Studio &amp; Beauty Bar to learn more about microblading.</p>\r\n<p class=\"p1\"><b>WE CAN ALSO REMOVE PREVIOUS WORK</b></p>\r\n<p class=\"p3\">If you’ve had Microblading done elsewhere and aren’t happy with the results, we offer saline tattoo removal. This is an alternative to the traditional laser removal method. We use a naturally based saline solution that we implant into the skin with a hand tool. The process is less invasive and much less expensive than going with the laser removal process. As the area heals, the scabs that form will then fall off while pulling the pigment with it. Pricing and how many sessions will depend on what needs to be corrected.\r\n\r\nCall 303-994-9439 today to schedule microblading in the Denver, CO area.</p>','Microblading','','inherit','closed','closed','','14-revision-v1','','','2018-01-04 05:21:37','2018-01-04 05:21:37','',14,'http://contouredink.com/2018/01/04/14-revision-v1/',0,'revision','',0),(25,1,'2018-01-04 05:22:08','2018-01-04 05:22:08','<p class=\"p1\"><b>Thicken Your Lashes</b></p>\r\n<p class=\"p3\"><b>Xtreme Lashes offer a natural look in Denver, CO</b></p>\r\n<p class=\"p4\">When you’re looking to thicken your eyelashes without the damage caused by mascara, Xtreme Lashes offers a natural-looking alternative. Contoured Ink Studio &amp; Beauty Bar’s certified Xtreme Lashes technician can transform your lashes to the customized look you select. These semi-permanent eyelash extensions are attached one by one to your natural lash.</p>\r\n<p class=\"p4\">Xtreme Lashes:</p>\r\n\r\n<ul class=\"ul1\">\r\n 	<li class=\"li4\">Take approximately three hours to apply</li>\r\n 	<li class=\"li4\">Provide natural looking lashes</li>\r\n 	<li class=\"li4\">Need to be maintained every two to three weeks</li>\r\n</ul>\r\n<p class=\"p4\">Xtreme Lashes are designed with a thicker base and tapered tip to resemble the look of natural eyelashes. If you\'re looking for Xtreme Lashes, eyelash extensions or synthetic eyelashes in Denver, CO Contoured Ink Studio &amp; Beauty Bar has you covered. Call 303-994-9439 today to learn more about Xtreme Lashes.</p>\r\n<p class=\"p3\"><b>YOUR NEW LASHES WILL SHED NATURALLY</b></p>\r\n<p class=\"p4\">While you’re relaxing and being pampered during your initial eyelash extension appointment, you can rest easy knowing that we use a medical-grade, fume-free glue to secure your new synthetic eyelashes. Because Xtreme Lashes are attached to your natural lash, they’ll shed naturally.\r\n\r\nContact Contoured Ink Studio &amp; Beauty Bar to schedule your Xtreme Lashes application in the Denver, CO area.</p>','Xtreme Lashes','','inherit','closed','closed','','16-revision-v1','','','2018-01-04 05:22:08','2018-01-04 05:22:08','',16,'http://contouredink.com/2018/01/04/16-revision-v1/',0,'revision','',0),(26,1,'2018-01-04 05:22:50','2018-01-04 05:22:50','<p class=\"p1\"><a href=\"http://contouredink.com/contact/\"><b>Beauty Bar Price List</b></a></p>\r\n<p class=\"p2\">Full Set of Lashes $150</p>\r\n1 Week Fill\r\nUp to an 1/8 of your Xtreme lashes filled\r\n1 hour $40\r\n\r\n2 Week Fill\r\nUp to 1/4 of your Xtreme Lashes filled\r\n1 hour $50\r\n\r\n3 Week Fill\r\nUp to 1/2 of your Xtreme Lashes filled\r\n$75\r\n\r\nSaline Tattoo Removal $250\r\n\r\n6D Microblading $500\r\n\r\nMicroblading color boost $150\r\n\r\nMicroblading consultation Free','Pricing','','publish','closed','closed','','pricing','','','2018-01-05 01:31:36','2018-01-05 01:31:36','',0,'http://contouredink.com/?page_id=26',0,'page','',0),(27,1,'2018-01-04 05:22:50','2018-01-04 05:22:50','<p class=\"p1\"><a href=\"http://contouredink.com/contact/\"><b>Beauty Bar Price List</b></a></p>\r\n<p class=\"p2\">Full Set of Lashes $150\r\n\r\n1 Week Fill\r\nUp to an 1/8 of your Xtreme lashes filled\r\n1 hour $40\r\n\r\n2 Week Fill\r\nUp to 1/4 of your Xtreme Lashes filled\r\n1 hour $50\r\n\r\n3 Week Fill\r\nUp to 1/2 of your Xtreme Lashes filled\r\n$75\r\n\r\nSaline Tattoo Removal $250\r\n\r\n6D Microblading $500\r\n\r\nMicroblading color boost $150\r\n\r\nMicroblading consultation Free</p>','Pricing','','inherit','closed','closed','','26-revision-v1','','','2018-01-04 05:22:50','2018-01-04 05:22:50','',26,'http://contouredink.com/2018/01/04/26-revision-v1/',0,'revision','',0),(28,1,'2018-01-04 05:23:18','2018-01-04 05:23:18','<p class=\"p1\"><a href=\"http://contouredink.com/contact/\"><b>Beauty Bar Price List</b></a></p>\r\n<p class=\"p2\">Full Set of Lashes $150</p>\r\n1 Week Fill\r\nUp to an 1/8 of your Xtreme lashes filled\r\n1 hour $40\r\n\r\n2 Week Fill\r\nUp to 1/4 of your Xtreme Lashes filled\r\n1 hour $50\r\n\r\n3 Week Fill\r\nUp to 1/2 of your Xtreme Lashes filled\r\n$75\r\n